description:
For most sales people, getting someone to buy their products can be a difficult task, but not for our solicitors. They know exactly how to make anyone buy anything.
The hottest lesbians are just dying for a sale and will do anything for you to buy their products, and I do mean anything. So sit back and enjoy as these smoking hot sales women get down and dirty with each other. There is nothing but hardcore lesbian action here. Definitely one sale you don't want to miss.

Cast: Nikol,  Nella, Mona Lee,  Winnie, Gioia Biel,  Mischelle, Carmen Blue, Bernadetta


